import React, { useState } from 'react';
import './App.css';
import FaqSection from './components/FAQ/FAQSection';
import BottomNavbar from './components/BNB/bottomNavBar';
import LoginModal from './components/Login/LoginModal';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';

// ðŸ”¹ COMPONENTE: PodrÃ¡s
const Podras = () => (
  <section className="podras-section py-10 bg-gray-100 text-center">
    <h2 className="text-2xl font-bold mb-6">PodrÃ¡s...</h2>
    <div className="grid grid-cols-2 md:grid-cols-5 gap-4 px-4">
      {["Comprar", "Vender", "Donar", "Explorar", "Compartir Ideas"].map((text, i) => (
        <div key={i} className="bg-white shadow rounded-xl p-4 hover:shadow-lg transition">
          <div className="text-xl font-semibold">{text}</div>
        </div>
      ))}
    </div>
  </section>
);

// ðŸ”¹ COMPONENTE: Aliados
const Aliados = () => (
  <section className="aliados-section py-10 text-center bg-white">
    <h2 className="text-2xl font-bold mb-6">ALIADOS</h2>
    <div className="grid grid-cols-3 md:grid-cols-5 gap-6 px-4">
      {[...Array(10)].map((_, i) => (
        <div key={i} className="bg-gray-200 h-20 rounded-lg flex items-center justify-center">Logo</div>
      ))}
    </div>
  </section>
);

// ðŸ”¹ COMPONENTE: ReseÃ±as
const ReseÃ±as = () => (
  <section className="reseÃ±as-section py-10 bg-gray-100 text-center">
    <h2 className="text-2xl font-bold mb-6">RESEÃ‘AS</h2>
    <Swiper
      spaceBetween={20}
      slidesPerView={1}
      breakpoints={{
        768: { slidesPerView: 2 },
        1024: { slidesPerView: 3 }
      }}
    >
      {[
        { stars: "â˜…â˜…â˜…â˜…â˜…", text: "Excelente plataforma, probÃ© antes de suscribirme." },
        { stars: "â˜…â˜…â˜…â˜…â˜†", text: "Muy Ãºtil, aunque podrÃ­a tener mÃ¡s apps." },
        { stars: "â˜…â˜…â˜…â˜…â˜…", text: "Ideal para estudiantes, fÃ¡cil de usar." }
      ].map((review, i) => (
        <SwiperSlide key={i}>
          <div className="bg-white rounded-xl p-4 shadow mx-4">
            <p className="text-yellow-500 text-xl mb-2">{review.stars}</p>
            <p className="italic">{review.text}</p>
            <p className="mt-2 font-semibold">â€” Usuario {i + 1}</p>
          </div>
        </SwiperSlide>
      ))}
    </Swiper>
  </section>
);

function App() {
  const [isLoginModalOpen, setIsLoginModalOpen] = useState(false);

  return (
    <div className="App">
      {/* Navigation Bar */}
      <nav className="navbar">
        <div className="navbar-brand">
          <span className="brand-prime">Prime</span>
          <span className="brand-testing"> Testing</span>
        </div>
        <div className="navbar-buttons">
          <button
            className="btn-login"
            onClick={() => setIsLoginModalOpen(true)}
          >
            Iniciar SesiÃ³n
          </button>
          <button className="btn-join">Unirse</button>
        </div>
      </nav>

      {/* Login Modal */}
      <LoginModal
        isOpen={isLoginModalOpen}
        onClose={() => setIsLoginModalOpen(false)}
      />

      {/* Main content of the page */}
      <main className="main-content">
        {/* Hero Section */}
        <div className="premium-services">
          <div className="text-content">
            <h1>
              PRUEBA LOS <span className="premium">SERVICIOS PREMIUM</span> DE TUS APLICACIONES FAVORITAS
            </h1>
            <p className="descripcion-home">
              ESCOGE LA APLICACIÃ“N QUE DESEES, PRUEBA Y DECIDE SI SUSCRIBIRTE
            </p>
            <button className="btn-join-2">UNIRSE</button>
          </div>
          <div className="image-content">
            <img src="/assets/images/GalleryViewWebPages.svg" alt="App Screenshots" className="app-image" />
          </div>
        </div>

        {/* Logos de Apps */}
        <div className="opciones-logos">
          <h2>Servicios de aplicaciones como...</h2>
          <div className="logos-container">
            <img src="/assets/images/Spotify.svg" alt="Spotify" />
            <img src="/assets/images/Patreon.svg" alt="Patreon" />
            <img src="/assets/images/AppleMusic.svg" alt="Apple Music" />
            <img src="/assets/images/Discord.svg" alt="Discord" />
            <img src="/assets/images/Youtube.svg" alt="YouTube" />
          </div>
        </div>

        {/* Secciones Adicionales */}
        <Podras />
        <Aliados />
        <ReseÃ±as />
        <FaqSection />
      </main>

      {/* Bottom Navigation Bar (opcional) */}
      {/* <BottomNavbar /> */}
    </div>
  );
}

export default App;
